INSERT INTO `email_templates` VALUES (1,'Invitation to a MySurveys study','Greetings *nickname* *nl*\n\nGreetings *seednickname* *nl*\n\n\nYou are invited to join the following study: *projecttitle**nl*\n\nProject description: This study investigates peopleâ€™s beliefs about vaccination.*nl*\n\nThe payment for participation is $10.00 USD. The study will be open until *projectenddate* or until enough people participate.*nl*\n\nIf you have any questions, please contact the research team at mysurveys@gmail.com*nl*\n\nPlease click on thebutton  below to start the project.*nl*\n\nThis is a link:  *link**nl*\n\n*buttonlink*',NULL,'2021-07-20 14:14:37'),(2,'MySurveys Reminder','Hello Template Update *username*, *nl**nl* We would like to remind you that you are invited to join\n                  the following study: *nl**nl* *projecttitle*. *nl* *nl* *projectinfo*.  *nl* *nl*\n                  The payment for participation is *maxpayout* USD. The study will be open until *projectenddate*,\n                  or until enough people participate.*nl* If you have any questions, please contact *responsibleperson*:\n                  *contactaddress*.*nl* *nl* Please click on the link below to log in to your account, or copy and paste\n                   it in your browser.  *nl*',NULL,'2021-07-18 16:24:20'),(3,'MySurveys Account Creation','We would like to remind you to finish signing up on the MySurveys platform. If you have not already done so please provide your PayPal information. We need PayPal account information in order to provide compensation for participating in the study. *nl* *nl*\nAs we mentioned, you will get $10 for signing up and $5 for completing the first study. We are very grateful for your participation. *nl* *nl*\n             If you have any questions, please contact *responsibleperson*:\n                  *contactaddress*.*nl* *nl* Please click on the link below to log in to your account, or copy and paste\n                   it in your browser.  *nl* https://mysurveys.santafe.edu/*nl*','2021-06-24 11:33:33','2021-06-25 05:06:22'),(4,'My Surveys Friend Invitations','We would like to remind you to invite two friends to the MySurveys platform. If you have already done so please  encourage them to sign up for our study. On the friends tab on the MySurveys platform you can also send reminders to your friends. As we mentioned, two of your friends need to sign up for MySurveys in order for you to participate in the study.*nl*After completing the first study wave, you will receive $10 for each friend that has signed up, and $5 for completing the study. For each next study wave you participate in, you will receive an additional $5 (for a total of $25).\n             If you have any questions, please contact *responsibleperson*:\n                  *contactaddress*.*nl* *nl* Please click on the link below to log in to your account, or copy and paste\n                   it in your browser.  *nl* https://mysurveys.santafe.edu/*nl*','2021-06-25 00:52:38','2021-06-26 15:52:55'),(5,'My Surveys Account','We would like to remind you to finish signing up on the MySurveys platform and invite two friends to the MySurveys platform.*nl* If you have not already done so please provide your PayPal information. We need PayPal account information in order to provide compensation for participating in the study. *nl**nl*If you have not already done so please invite at least two friends and encourage them to sign up for our study. As we mentioned, two of your friends need to sign up for MySurveys in order for you to participate in the study. \n*nl*After completing the first study wave, you will receive $10 for each friend that has signed up, and $5 for completing the study. For each next study wave you participate in, you will receive an additional $5 (for a total of $25). \n             If you have any questions, please contact *responsibleperson*:\n                  *contactaddress*.*nl* *nl* Please click on the link below to log in to your account, or copy and paste\n                   it in your browser.  *nl* https://mysurveys.santafe.edu/*nl*','2021-06-26 15:16:09','2021-06-26 15:30:43');
